import React from 'react';

const aboutUs = (props) => {
	return (
		<div>
			<h1>About Us</h1>
			<div>We are the world's premiere company for procrastinating.</div>
			<div>More info to come later. . .</div>
		</div>
	);
}

export default aboutUs;
